script: |
  super -f text -I q1209.spq | sort > q1209.out

inputs:
  - name: q1209.spq
    data: |
      SELECT DISTINCT col0 * + col0 / col2 AS col2 FROM tab0 (FORMAT parquet) WHERE col0 BETWEEN NULL AND - col0 + col1 - - col0 * + col0 * - col1;
  - name: tab0

outputs:
  - name: q1209.out
    data: |
